import Note from './components/Note'

import { useState } from 'react'

const App = ({ props } ) => {
  const[notes, setNotes] =  useState(props.notes)

  return (
    <div>
      <h1>Notes</h1>
      <ul>
        {props.notes.map(note => 
          <Note key={props.note.id} note={props.note} />
        )}
      </ul>
    </div>
  )
}

export default App
